import { Injectable } from "@angular/core";
import { Orden } from "../modelos/orden.model";
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { BehaviorSubject, Observable, Subject } from "rxjs";
import * as pdfMake from 'pdfmake/build/pdfMake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { table } from "console";
import { Cliente } from "../modelos/cliente.model";
(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;

@Injectable({
    providedIn: 'root'
})
export class OrdenesService{
    private orden$ = new Subject<any>();
    private paramSource = new BehaviorSubject<Orden[] | undefined>([]);
    sharedParam = this.paramSource.asObservable();

    constructor(private firestore: AngularFirestore){}

    agregarOrden(orden:Orden): Promise<any>{
        return this.firestore.collection('ordenes').add(orden)
    }

    obtenerOrdenes(acomodo:string): Observable<any>{
        if(acomodo == ""){
            return this.firestore.collection('ordenes', ref => ref.orderBy('inVoice', 'asc')).snapshotChanges();
        }else{
            return this.firestore.collection('ordenes', ref => ref.orderBy(acomodo, 'asc')).snapshotChanges();
        }
    }

    eliminarOrden(id: string): Promise<any>{
        return this.firestore.collection('ordenes').doc(id).delete();
    }

    addEditarOrden(orden: Orden){
        this.orden$.next(orden);
    }
    
    getEditarOrden(): Observable<Orden>{
        return this.orden$.asObservable();
    }

    editarOrden(id: string, orden: any): Promise<any>{
        return this.firestore.collection('ordenes').doc(id).update(orden);
    }

    buscarOrden(id: string | undefined): Observable<any>{
        return this.firestore.collection('ordenes').doc(id).get();
    }

    sendParam(param: Orden[] | undefined) {
        this.paramSource.next(param);
    }

    createPDF(param: Orden[], cliente: Cliente[]) {
      let columns;
      function tableColumns(){
        let tableData = [];
        let long = param[0].productos.length;

        for(let i = 0; i < long ; i++){
          tableData.push([
            [param[0].productos[i].idProducto],
            [param[0].productos[i].cantidad],
            [param[0].productos[i].nombre],
            [param[0].productos[i].cantidadCaja],
            [param[0].productos[i].precioUnitario],
            [param[0].productos[i].importeTotal]
          ]);
        }
        return tableData;
      }
      columns = tableColumns();
        let pdfDefinition = {
          pageSize : 'A4',
          content: [
            {
              columns:[
                {
                  image: 'logoEmpresa',
                  width: 200,
                  height: 150
                },
                /*Headers*/
                {text: 'Date', style: 'header', alignment: 'justify', margin: [50, 0, 0, 0]},
                {text: 'Invoice', style: 'header', alignment: 'justify', margin: [50, 0, 0, 0]},
                {text: 'P.O No', style: 'header', alignment: 'justify', margin: [50, 0, 0, 0]},
                //DATOS
                /*margin: [left, top, right, bottom]*/
                {text: param[0].fecha, style: 'header', alignment: 'justify', margin: [-230, 20, 0, 0]},
                {text: param[0].inVoice, style: 'header', alignment: 'justify', margin: [-217, 20, 0, 0]},
                //Headers
                {text: 'Bill to:', style: 'header', alignment: 'justify', margin: [-390, 100, 0, 0]},
                //Headers
                {text: 'Butcher Shop Distribution Corp.', bold: true, fontSize: 11, alignment: 'justify', margin: [-700, 145, 0, 0]},
                {text: '4660 S. Eastern Ave Suite #105 ', fontSize:11, bold: true, alignment: 'justify', margin: [-790, 160, 0, 0]},
                {text: 'Las Vegas, NV 89119', fontSize: 11, bold: true, alignment: 'justify', margin: [-850, 175, 0, 20]},
                //Datos
                {text: cliente[0].nombre, bold: true, fontSize: 11, alignment: 'justify', margin: [-743, 115, 0, 0]},
                {text: cliente[0].direccion, bold: true, fontSize: 11, alignment: 'justify', margin: [-831, 130, 0, 0]},
                {text: cliente[0].ciudad, bold: true, fontSize: 11, alignment: 'justify', margin: [-919, 145, 0, 0]},   
                {text: cliente[0].estado, bold: true, fontSize: 11, alignment: 'justify', margin: [-965,145, 0, 0]},
                {text: cliente[0].codigoPostal, bold: true, fontSize: 11, alignment: 'justify', margin: [-1030, 145, 0, 0]},  
                
              ],
            },                   
            {
              style: 'tableExample',
              alignment: 'center',
              table: {
                widths: [80,80,80,80,80,80],
                body: [               
                  ['Item','Quantity','Description','Case','Rate','Amount'],
                  ...columns
                ]
              }
            }
          ],
          images:{
            logoEmpresa: 'data:image/jpeg;base64,'
          }
        };
        pdfMake.createPdf(pdfDefinition).open();
      }
}